var_str = "Python Programming"

"""# capitalize() -> str

Return a capitalized version of the string.

More specifically, make the first character have upper case and the rest lower case.
"""

var_str = "python programming"
var_str.capitalize()

"""# casefold() -> str

Return a version of the string suitable for caseless comparisons.
"""

var_str = "PYTHON PROGRAMMING"
var_str.casefold()

"""# center(__width: SupportsIndex, __fillchar: str = ...) -> str

Return a centered string of length width.

Padding is done using the specified fill character (default is a space).


"""

print(var_str.center(25))
print(var_str.center(50))
print(var_str.center(75))
print(var_str.center(100))
print(var_str.center(25, '*'))
print(var_str.center(50, '#'))
print(var_str.center(75, '$'))
print(var_str.center(100, '@'))

"""# count(x: str, __start: SupportsIndex | None = ..., __end: SupportsIndex | None = ...) -> int
S.count(sub[, start[, end]]) -> int

Return the number of non-overlapping occurrences of substring sub in
string S[start:end].  

Optional arguments start and end are
interpreted as in slice notation.
"""

var_str = "Peppa pig personal likes Python Programming"
print(var_str.count('p'))
print(var_str.count('a'))
print(var_str.count('e'))
print(var_str.count('P'))
print(var_str.count('p',0,5))
print(var_str.count('p',0,11))
print(var_str.count('p',5,11))
print(var_str.count('p',11,len(var_str)))
print(var_str.count('a',20,len(var_str)))
print(var_str.count('e',9,len(var_str)))
print(var_str.count('P',25,len(var_str)))

